description:
Penetration were a punk rock band originally formed in 1976. They re-formed in 2001 with several new members.

The lead singer is Pauline Murray (born 8 March 1958 in Waterhouses, County Durham, England). Other members included Robert Blamire, Gary Smallman, and Gary Chaplin, and later Neale Floyd and Fred Purser. Steve Wallace and Paul Harvey were drafted in as new guitarists in 2001. Their first, and most famous single, was &quot;Don&amp;#039;t Dictate&quot;; and they have now released a Best of Penetration compilation album. The studio albums released were Moving Targets and Coming Up For Air. After the band had split an album called Race Against Time was released, which was a collection of early demos and live tracks.




